import React from "react";
import {
  FiGithub,
  FiLinkedin,
  FaReact
} from "react-icons/fi";

const skillsContent = [
  {
    name: "React.Js",
    skillPercent: "95",
    iconName: <FiGithub />,
  },
  {
    name: "Vue.Js",
    skillPercent: "80",
  },
  {
    name: "Photoshop",
    skillPercent: "90",
  },
  {
    name: "Figma",
    skillPercent: "95",
  },
  {
    name: "Illustrator",
    skillPercent: "80",
  },
  {
    name: "WordPress",
    skillPercent: "90",
  },
];

const Skills = () => {
  return (
    <>
      {skillsContent.map((val, i) => (
        <div className="progress_inner" key={i}>
          <span className="label">{val.name}</span>
          <div className="background">
            <div className="bar">
              <div
                className="bar_in"
                style={{ width: val.skillPercent + "%" }}
              ></div>
            </div>
          </div>
        </div>
      ))}
    </>
  );
};

export default Skills;
